void PrintASN1PusSt18ObservabilityLevel(const char *paramName, const asn1SccPusSt18ObservabilityLevel *pData)
{
#ifdef __linux__
    pthread_mutex_lock(&g_printing_mutex);
#endif
    //printf("%s PusSt18ObservabilityLevel ::= ", paramName);
    printf("%s ", paramName);
    switch((*pData)) {
    case 0:
        printf("none");
        break;
    case 1:
        printf("procedure");
        break;
    case 2:
        printf("step");
        break;
    case 3:
        printf("detailed");
        break;
    default:
        printf("Invalid value in ENUMERATED ((*pData))");
    }
#ifdef __linux__
    pthread_mutex_unlock(&g_printing_mutex);
#endif
}

